import logo from './logo.svg';
import './App.css';
import React, { PureComponent } from 'react';
import { Button, Grid, TextField, Paper, Box } from '@material-ui/core';
// import EmojiResults from "./EmojiResults";
import SideNav from './components/sideNav';
import SearchInput from "./components/SearchInput";
import { createTheme } from '@material-ui/core/styles';


export default class App extends PureComponent {



  render() {

    return (
      <div>
    <div className="App">


      <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap" />
      <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Poppins:300,400,500,700&display=swap" />
      <header className="App-header">
      <SideNav></SideNav>
      {/* <Grid
      direction="column"
      justifyContent="flex-start"
      alignItems="flex-start"
      className="SearchBox">

      </Grid> */}
      <Box marginLeft={60}>
        <Grid
         className="landingContent"
          container xs={15} 
          spacing={3}
         >
          <Grid item xs={12}><TextField color="primary" InputLabelProps={{className: 'textfield__label'}} className="searchBox" id="outlined-basic" label="Search" variant="outlined" /></Grid>
          <Grid item xs={6}>
            <Paper className>xs=6</Paper>
          </Grid>
          <Grid item xs={6}>
            <Paper className>xs=6</Paper>
          </Grid>
          <Grid item xs={6}>
            <Paper className>xs=6</Paper>
          </Grid>
          <Grid item xs={3}>
            <Paper className>xs=3</Paper>
          </Grid>
          <Grid item xs={3}>
            <Paper className>xs=3</Paper>
          </Grid>
          <Grid item xs={3}>
            <Paper className>xs=3</Paper>
          </Grid>
          <Grid item xs={3}>
            <Paper className>xs=3</Paper>
          </Grid>
        </Grid>
        </Box>
      </header>
    </div>
      </div>
    );
  }
}
